import React, {Suspense, useEffect, useState} from 'react';
import {Pressable, Text, View} from 'react-native';
import {useSafeAreaInsets} from "react-native-safe-area-context";
import {entryStyles as styles} from "../assets/styles/styles";
import {Header} from "../components/Header";
import QRCodeStyled from 'react-native-qrcode-styled';
import {format} from "date-fns";
import {useGetUser} from "../api/user";
import Icon from "@expo/vector-icons/FontAwesome";
import {Dialog, Portal, RadioButton} from "react-native-paper";
import {useGetUserNumberPlates} from "../api/numberPlates";
import {number_plate} from "../api/types";
import {LoadingScreen} from "../components/LoadingScreen";

const Entry = ({navigation, route}: any) => {
    const insets = useSafeAreaInsets();
    const {data: user} = useGetUser();
    const {data: number_plates} = useGetUserNumberPlates();

    const [qrValue, setQRValue] = useState({
        id: user?.id || 0,
        number_plate: number_plates?.[0] || {id: 0, number_plate: ""} as number_plate,
        entry_time: new Date(),
        directoryID: 0,
    });

    const [showNPDialog, setShowNPDialog] = useState(false);

    const futureDate = new Date(qrValue.entry_time.getTime() + 15*60000);

    useEffect(() => {
        return navigation.addListener('focus', () => {
            setQRValue({
                ...qrValue,
                entry_time: new Date(),
            });
        });
    }, [navigation]);

    useEffect(() => {
        setQRValue({
            ...qrValue,
            number_plate: number_plates?.[0] || {id: 0, number_plate: ""} as number_plate,
        });
    }, [number_plates]);

    return (
        <Suspense fallback={<LoadingScreen/>}>
            <View style={{
                flex: 1,
                paddingTop: insets.top,
                paddingBottom: insets.bottom,
                paddingLeft: insets.left,
                paddingRight: insets.right,
                width: "100%",
            }}>
                <Header navigation={navigation} route={route}/>
                <View style={styles.container}>
                    <View style={styles.qrContainer}>
                        <QRCodeStyled
                            data={JSON.stringify(qrValue)}
                            style={styles.qrCode}
                        />
                    </View>
                    <Pressable
                        onPress={() => setQRValue({...qrValue, entry_time: new Date()})}
                        style={styles.refreshButton}
                    >
                        <Icon name="refresh" size={20} color="black"/>
                    </Pressable>
                    <View style={styles.container}>
                        <View style={styles.row}>
                            <Text style={styles.field}>
                                {"Name: "}
                            </Text>
                            <Text style={styles.data}>
                                { user?.name }
                            </Text>
                        </View>
                        <View style={styles.row}>
                            <Text style={styles.field}>
                                {"Valid Time: "}
                            </Text>
                            <Text style={styles.data}>
                                { format(qrValue.entry_time, "h:mm aa") + " - " + format(futureDate, "h:mm aa") }
                            </Text>
                        </View>
                        <View style={styles.row}>
                            <Text style={styles.field}>
                                {"Car: "}
                            </Text>
                            <Text style={{
                                ...styles.data,
                                padding: 10,
                                borderWidth: 1,
                                borderColor: "black",
                                borderRadius: 5,
                                marginHorizontal: 10,
                            }}>
                                {qrValue.number_plate.number_plate}
                            </Text>
                            <Pressable
                                onPress={() => setShowNPDialog(true)}
                                style={styles.actionButton}
                                disabled={showNPDialog}
                            >
                                <Text style={styles.actionButtonLabel}>
                                    {qrValue.number_plate.number_plate != "" ? "Select" : "Change"}
                                </Text>
                            </Pressable>
                            <Portal>
                                <Dialog
                                    visible={showNPDialog}
                                    onDismiss={() => setShowNPDialog(false)}
                                    dismissableBackButton={true}
                                >
                                    <Dialog.Actions>
                                        <Pressable
                                            onPress={() => setShowNPDialog(false)}
                                        >
                                            <Icon name="close" size={20} color="black"/>
                                        </Pressable>
                                    </Dialog.Actions>
                                    <Dialog.Title>
                                        {"Select Car"}
                                    </Dialog.Title>
                                    <Dialog.Content>
                                        <RadioButton.Group
                                            onValueChange={value => {
                                                setQRValue({
                                                    ...qrValue,
                                                    number_plate: number_plates?.find((np: number_plate) => np.number_plate === value) || {id: 0, number_plate: ""},
                                                });
                                            }}
                                            value={qrValue.number_plate.number_plate}
                                        >
                                            {
                                                number_plates?.map((np: number_plate) => (
                                                    <View style={styles.row} key={np.id}>
                                                        <RadioButton.Item
                                                            key={np.id}
                                                            label={np.number_plate}
                                                            value={np.number_plate}
                                                            position="leading"
                                                        />
                                                    </View>
                                                ))
                                            }
                                        </RadioButton.Group>
                                    </Dialog.Content>
                                </Dialog>
                            </Portal>
                        </View>
                    </View>
                </View>
            </View>
        </Suspense>
    );
};

export default Entry;
